import React from "react";
import styled from "styled-components/macro";

const HorMar = styled.span`
    display: flex;
    width: ${({margin}) =>
        typeof margin === "string" ? margin : `${margin}px`};
`;

const VerMar = styled.span`
    display: flex;
    height: ${({ margin}) =>
        typeof margin === "string" ? margin : `${margin}px`};
`;

function Margincontrol(props) {
    const { direction } = props;

    if (direction === "horizontal") return <HorMar {...props} />;
    else {
        return <VerMar {...props} />;
    }
}
